import React from 'react';

function Body() {
    return (
        <React.Fragment>
            <p>This is my Paragraph</p>  
            <ol>
                <li>Hello</li>
                <li>Its Me</li>
                <li>Shankar Lamichhane</li>
            </ol>
        </React.Fragment>
    );
}
export default Body;
